$(document).ready(function(){

	var body = $('body');
	var html = $('html');
	var viewport = $(window);

	/* ==========================================================================
	   Menu
	   ========================================================================== */

	$('#menu-button').on('click', function() {
		html.addClass('menu-active');
	});

	$('.hidden-close, .close-button').on('click', function() {
		html.removeClass('menu-active');
	});

	/* ==========================================================================
	   Parallax cover
	   ========================================================================== */

	var cover = $('.cover');
	var coverPosition = 0;

	function prlx() {
		if(cover.length >= 1) {
			var windowPosition = viewport.scrollTop();
			(windowPosition > 0) ? coverPosition = Math.floor(windowPosition * 0.25) : coverPosition = 0;
			cover.css({
				'-webkit-transform' : 'translate3d(0, ' + coverPosition + 'px, 0)',
				'transform' : 'translate3d(0, ' + coverPosition + 'px, 0)'
			});
			(viewport.scrollTop() < cover.height()) ? html.addClass('cover-active') : html.removeClass('cover-active');
		}
	}
	prlx();

	viewport.on({
		'scroll': function() {
			prlx();
		},
		'resize': function() {
			prlx();
		},
		'orientationchange': function() {
			prlx();
		}
	});

	/* ==========================================================================
	   Reading Progress
	   ========================================================================== */

	var post = $('.post-content');

	function readingProgress() {
		if(post.length >= 1) {
			var postBottom = post.offset().top + post.height();
			var windowBottom = viewport.scrollTop() + viewport.height();
			var progress = 100 - (((postBottom - windowBottom) / (postBottom - viewport.height())) * 100);
			$('.progress-bar').css('width', progress + '%');
			(progress > 100) ? $('.progress-container').addClass('ready') : $('.progress-container').removeClass('ready');
		}
	}
	readingProgress();

	viewport.on({
		'scroll': function() {
			readingProgress();
		},
		'resize': function() {
			readingProgress();
		},
		'orientationchange': function() {
			readingProgress();
		}
	});

	/* ==========================================================================
	   Gallery
	   ========================================================================== */

	function gallery() {
		var images = document.querySelectorAll('.kg-gallery-image img');
		images.forEach(function (image) {
			var container = image.closest('.kg-gallery-image');
			var width = image.attributes.width.value;
			var height = image.attributes.height.value;
			var ratio = width / height;
			container.style.flex = ratio + ' 1 0%';
		});
	}
	gallery();

	/* ==========================================================================
	   Style code blocks with highlight and numbered lines
	   ========================================================================== */

	function codestyling() {
		$('pre code').each(function(i, e) {
			hljs.highlightBlock(e);

			if(!$(this).hasClass('language-text')) {
				var code = $(this);
				var lines = code.html().split(/\n/).length;
				var numbers = [];
				for (i = 1; i < lines; i++) {
					numbers += '<span class="line">' + i + '</span>';
				}
				code.parent().append('<div class="lines">' + numbers + '</div>');
			}
		});
	}
	codestyling();

	/* ==========================================================================
	   Responsive Videos with Fitvids
	   ========================================================================== */

	function video() {
		$('#wrapper').fitVids();
	}
	video();

	/* ==========================================================================
	   Initialize and load Disqus
	   ========================================================================== */

	if (typeof disqus === 'undefined') {
		$('.post-comments').css({
			'display' : 'none'
		});
	} else {
		$('#show-disqus').on('click', function() {
			$.ajax({
				type: "GET",
				url: "//" + disqus + ".disqus.com/embed.js",
				dataType: "script",
				cache: true
			});
			$(this).parent().addClass('activated');
		});
	}

	/* ==========================================================================
	   Noty
	   ========================================================================== */

	var message = 'Error management for .NET web applications: <a href="https://elmah.io/?utm_source=thomasardal&utm_campaign=thomasardaltopbar&utm_medium=blog">elmah.io</a>',
		image = '/assets/img/elmah-logo.png',
		cookie = Cookies.get('elmah-info');

	var noty_template = '<div class="noty_message">'+
		            	'<div class="noty-picture"><img src="'+image+'" alt="elmah.io" /></div>'+
		            	'<div class="noty-msg">'+
		            	'<span class="noty-message">'+message+'</span>'+
		            	'<span class="noty-social">'+
		            	'<a class="twitter" href="http://twitter.com/elmah_io" target="_blank"><i class="fa fa-twitter" aria-hidden="true"></i></a>'+
		            	'<a class="facebook" href="https://www.facebook.com/elmahdotio/" target="_blank"><i class="fa fa-facebook" aria-hidden="true"></i></a>'+
		            	'<a class="linkedin" href="https://www.linkedin.com/company/elmah-io/" target="_blank"><i class="fa fa-linkedin" aria-hidden="true"></i></a>'+
		            	'</span>'+
		            	'</div>'+
		            	'<div class="noty_close_button">&times;</div>'+
		            	'</div>';

	if(cookie != "elmah") {
		setTimeout(function(){
			var noty = new Noty({
	            text: noty_template,
	            layout: 'topLeft',
	            closeWith: ['button']
	        }).on('onClose', function() {
				Cookies.set('elmah-info', 'elmah', { expires: 7 });
			}).show();
		}, 5000);
	}

	// Creates Captions from Alt tags
    $(".post-content img").each(function() {
        // Let's put a caption if there is one
        if ($(this).attr("alt")) {
            $(this).wrap(
                '<figure class="image"></figure>'
            ).after(
                '<figcaption>' +
                $(this).attr(
                    "alt") +
                '</figcaption>'
            );
        }
    });

    /* ==========================================================================
	   Search
	   ========================================================================== */

	if($("#search").length != 0) {
    	$.get(ghost.url.api('posts', {limit: 'all', fields: "url,title"})).done(searchData);

    	function searchData(data) {
    		let container = $("#searchList");
    		let options = {
				shouldSort: true,
				tokenize: true,
				threshold: 0,
				location: 0,
				distance: 100,
				maxPatternLength: 32,
				minMatchCharLength: 1,
				keys: [
			    	"title"
				]
			};

			let fuse = new Fuse(data.posts, options);

			$('#search').on('keyup', function(){
				let result = fuse.search(this.value);
				if(result.length === 0) {
					container.html('');
				} else {
					container.html('');
	    			container.append("<ul><h3>Search results</h3></ul>");
	    		}
				result.forEach(function(value){
					$("#searchList ul").append("<li><a href='" + value.url +"'>" + value.title + "</a></li>");
				});
			});
    	}
    }
});
